let randNum=0;let numbers=[];function getRandomInt(c,b){return Math.floor(Math.random()*(b-c+1))+c}function rand(c,b){return Math.random()*(b-c)+c}function getWeightedRandom(c,b){let total_weight=b.reduce(function(d,e){return d+e});let random_num=rand(0,total_weight);let weight_sum=0;for(let i=0;i<c.length;i++){weight_sum+=b[i];weight_sum=+weight_sum.toFixed(2);if(random_num<=weight_sum){return c[i]}}}function shuffle(c,b){let a=[];while(a.length<b){let randomnumber=Math.floor(Math.random()*c)+1;if(a.indexOf(randomnumber)>-1){continue}a[a.length]=randomnumber}return a}function random(c,b,e,d){$.ajax({url:"https://api.random.org/json-rpc/2/invoke",type:"POST",data:JSON.stringify({jsonrpc:"2.0",method:"generateIntegers",params:{apiKey:"e7cca124-0c36-460c-972a-163ba70fd2dc",n:e,min:c,max:b,replacement:d,base:10},id:28247}),contentType:"application/json; charset=utf-8",dataType:"json",success:function(f){if(e>1){numbers=f.result.random.data;$.each(numbers,function(g,h){console.log(h)})}else{randNum=JSON.stringify(f.result.random.data[0]);console.log(JSON.stringify(f.result.random.data[0]))}},error:function(f){console.log("File not found")}});if(e>1){return numbers}else{return parseInt(randNum)}};